import React from 'react'
import { NavLink } from 'react-router-dom'

function Information() {
  return (
    <div>
        <h1>Information </h1>

        <NavLink to="/"> Home</NavLink>
&nbsp;
<NavLink to="/abouts"> AboutUs</NavLink>
&nbsp;
<NavLink to="/contactus"> ContactUs</NavLink>
    </div>
  )
}

export default Information
